Step-by-step reasoning:
1. Key Psychological Mechanisms: For responders, the decision to accept a proposal is driven by their fairness judgment. They compare the offered share (split_self) to the fair share they expect given their contribution relative to the opponent’s (using token_self, token_opp, and combined_earning). A deviation from fairness produces a fairness “error” that can either encourage or dissuade acceptance.
2. Interaction of Mechanisms: The fairness error is computed as the difference between the offered share and the participant’s fair share. This error is then weighted by a sensitivity parameter (beta1) and combined with a baseline propensity (beta0). A positive overall utility (U) corresponds to a higher probability of accepting the proposal, mapped via a logistic function.
3. Mathematical Form: The model computes the fair share as (token_self/(token_self + token_opp)) * combined_earning. The fairness error is then (split_self - fair_share). The utility is a linear function of this error plus a baseline, i.e., U = beta0 + beta1 × fairness_error. The logistic transformation of U gives the acceptance probability.
4. Required Parameters: Two learnable parameters are included—the baseline parameter beta0 and sensitivity parameter beta1—both with generous finite bounds. These parameters are designed to ensure recovery and limit covariance.
5. Mapping to Observed Behavior: The model uses observed data (split_self, token_self, token_opp, combined_earning) to compute the fairness error and hence utility. The predicted acceptance probability is then compared to the observed binary decision variable "accept".

The formal model specification is provided below.

<MODEL>
U = beta0 + beta1*(split_self - (token_self/(token_self+token_opp))*combined_earning)
p_accept = 1/(1+exp(-U))
</MODEL>

